import React from "react";
import { Link } from "react-router-dom";
import { NavItem } from "reactstrap";
import styled from "styled-components";
const SiderbarLink = styled(Link)`
display: flex;
color: #e1e9c;
`;
const SiderbarLabel=styled.span`
`;


const SubMenu =({item})=>{
return(
        <div>
            <SiderbarLink to={NavItem.path}>
               <div>
                   {NavItem.icon}
                   <SiderbarLabel>{NavItem.title}</SiderbarLabel>
               </div> 
            </SiderbarLink>
        </div>
);

};
export default SubMenu
